import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import reportWebVitals from "./reportWebVitals";

const title = "Hello,world!";
const body = "本文です";

const hoge = () => {
  return "文字列を返す";
};

const returnReactElem = () => {
  return <h2>テキスト</h2>;
};

const returnReactElem2 = (text: string, word: string) => {
  return (
    <div>
      <h2>{text}</h2>
      <h2>{word}</h2>
    </div>
  );
};

const Component1 = (props: componentProps) => {
  return (
    <h2>
      {props.name} {props.jop}
    </h2>
  );
};

// 全部のプロパティをオプションにする
type componentProps = Partial<{
  name: string;
  jop: string;
}>;

// React要素を指定されたcontainerの中のDOMにレンダリング
ReactDOM.render(
  // use strictと同じ
  <React.StrictMode>
    <Component1 name="山田" jop="歌手" />
  </React.StrictMode>,
  document.getElementById("root")
);

